const Menu = () => {

const itemList = [{
    name: 'Humble Pie',
    price: '$7.99'
},
{
    name: 'Grumblecakes',
    price: '$5.99'
},

{
    name: 'Tumblepuppies, Hush',
    price: '$3.99'
}
]

return(
<ul>
    {itemList.map((item) => (
    <MenuItem name={item.name} price={item.price} key={Math.random()}/>))}
</ul>
);

}

export default Menu;
